description:
This torrent includes all of Beck's studio albums. It does not include singles or recorded concerts or anything like that. All albums EXCEPT Golden Feelings and One Foot in the Grave are in FLAC, those two are in mp3 (simply because that's what I could find).


SEED WHEN YOU'RE DONE DOWNLOADING! This torrent isn't exactly small, so downloading it is a huge bitch when nobody's seeding, and my upload speed is only so fast.
